import React, { useEffect, useState } from 'react';

import { List, Button } from 'antd'
import Item from "../components/Item";
import { Game } from "../types";
import { Center } from "../hoc/Center"
import { socketio } from '../socket'


function Home() {

    const [game, setGame] = useState<Game[]>([])

    const [newGame, setNewGame] = useState("")

    useEffect(() => {
        socketio.on('connect', () => {
            console.log('connected')
        });

        socketio.on('disconnect', () => {
            console.log('disconnected')
        });

        socketio.on('games', (data: string) => {
            setGame(JSON.parse(data))
        });

    }, [])

    return (
        <>
            <Center>
                <Button type="primary" size={'large'} className={'add-button'}>
                    Створити гру
                </Button>
                {/*<Input placeholder="Basic usage" />;*/}

                <List
                    header={<div style={{ textAlign: 'center' }}>Список ігор</div>}
                    footer={<div style={{ textAlign: 'center' }}>Хрестики нолики онлайн</div>}
                    bordered
                    dataSource={game}
                    renderItem={(item: Game) => (
                        <List.Item>
                            <Item {...item}/>
                        </List.Item>
                    )}
                />
            </Center>
        </>
    );
}

export default Home;
